import groovy.time.TimeCategory

dateAtMidnight = new Date()
newtime = dateAtMidnight.clearTime()
use(TimeCategory) {
	 def starttime = newtime + 5.days 
 def timeinmills = starttime.getTime().toString()
   log.info timeinmills
   testRunner.testCase.getTestStepByName( "Properties" ).setPropertyValue("dayStart",timeinmills )

}

